//SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.9;
pragma abicoder v2;

import '@uniswap/v3-periphery/contracts/libraries/TransferHelper.sol';
import '@uniswap/v3-periphery/contracts/interfaces/ISwapRouter.sol';
import '@uniswap/v3-periphery/contracts/interfaces/IQuoter.sol';

interface IUniSwapRouter is ISwapRouter {
    function refundETH() external payable;
}

contract Swap {
    uint24 public constant poolFee = 3000;
    address public dai;
    address public weth9;
    IUniSwapRouter public constant swapRouter = IUniSwapRouter(0xE592427A0AEce92De3Edee1F18E0157C05861564);
    IQuoter public constant quoter = IQuoter(0xb27308f9F90D607463bb33eA1BeBb41C27CE5AB6);
    constructor(address _dai, address _weth) {
        dai = _dai;
        weth9 = _weth;
    }

    // Used to accept swapRouter refund 
    receive() external payable {
    }

    function convertEthToExactDai(uint256 _amountOut) external payable returns(uint256 _amountIn) {
        ISwapRouter.ExactOutputSingleParams memory params =
            ISwapRouter.ExactOutputSingleParams({
                tokenIn: weth9,
                tokenOut: dai,
                fee: poolFee,
                recipient: msg.sender,
                deadline: block.timestamp,
                amountOut: _amountOut,
                amountInMaximum: msg.value,
                sqrtPriceLimitX96: 0
            });

        _amountIn = swapRouter.exactOutputSingle(params);
        swapRouter.refundETH();
        // Send the refunded either back to sender
        (bool success, ) = msg.sender.call{value: address(this).balance }('');
        require(success, "Transfer failed");
    }
}
